import React, { useEffect, useState, useCallback, useMemo } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Cart = () => {
  const [cartItems, setCartItems] = useState([]);
  const [totalPrice, setTotalPrice] = useState(0);
  const [uploadedFiles, setUploadedFiles] = useState({}); // Track uploaded files
  const navigate = useNavigate();

  const user_data = useMemo(
    () => ({ user_id: sessionStorage.getItem("user_id") }),
    []
  );

  const fetchCart = useCallback(async () => {
    if (!user_data.user_id) {
      console.error("No user ID found in session.");
      return;
    }

    try {
      const response = await axios.post(
        "http://localhost:8000/medical_store_app/cart/",
        user_data
      );

      const { cart_items, total_price } = response.data;

      setCartItems(cart_items || []);
      setTotalPrice(total_price || 0);
    } catch (error) {
      console.error("Error fetching cart items:", error);
    }
  }, [user_data]);

  useEffect(() => {
    fetchCart();
  }, [fetchCart]);

  const handleFileUpload = async (event, cartId) => {
    const file = event.target.files[0];
    if (file) {
      const formData = new FormData();
      formData.append("prescription", file);

      try {
        const response = await axios.post(
          `http://localhost:8000/medical_store_app/cart/upload_prescription/${cartId}/`,
          formData,
          {
            headers: { "Content-Type": "multipart/form-data" },
          }
        );
        console.log("File upload response:", response.data);
        setUploadedFiles((prev) => ({ ...prev, [cartId]: true })); // Mark as uploaded
      } catch (error) {
        console.error("Error uploading file:", error);
      }
    }
  };

  const handleProceedToCheckout = () => {
    const allFilesUploaded = cartItems.every(
      (item) => uploadedFiles[item.id] || !item.requiresPrescription
    );
    if (!allFilesUploaded) {
      alert("Please upload prescriptions for all required items.");
      return;
    }
    navigate("/checkout", { state: { totalPrice } });
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Your Cart</h1>
      <table style={styles.table}>
        <thead>
          <tr>
            <th style={styles.tableHeader}>Medicine</th>
            <th style={styles.tableHeader}>Quantity</th>
            <th style={styles.tableHeader}>Prescription</th>
          </tr>
        </thead>
        <tbody>
          {cartItems.map((item) => (
            <tr key={item.id}>
              <td>{item.medicine.name}</td>
              <td>{item.quantity}</td>
              <td>
                <input
                  type="file"
                  onChange={(e) => handleFileUpload(e, item.id)}
                  style={styles.fileInput}
                />
                {uploadedFiles[item.id] && <span>Uploaded</span>}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <h3 style={styles.total}>Total: ₹{totalPrice}</h3>
      <button
        style={styles.paymentButton}
        onClick={handleProceedToCheckout}
      >
        Proceed to Checkout
      </button>
    </div>
  );
};

const styles = {
  container: { padding: "50px", fontFamily: "Arial, sans-serif" },
  heading: { textAlign: "center", fontSize: "2rem", marginBottom: "20px" },
  table: { width: "100%", marginBottom: "20px", borderCollapse: "collapse" },
  tableHeader: { fontWeight: "bold", textAlign: "left", padding: "10px" },
  fileInput: { margin: "10px 0" },
  paymentButton: { marginTop: "20px", padding: "10px 20px", cursor: "pointer" },
  total: { textAlign: "right", fontSize: "1.5rem", fontWeight: "bold" },
};

export default Cart;
